import React, { Component } from 'react';
import logo from '../logo.jpeg';

class Header extends Component {
    render() {
        return (
            <div className="header">
                <h1><a href=""><img src={logo} alt="FESTIVAL DE CANNES" /></a></h1>
                <ul className="year_list">
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                                this.props.onChangeYear('all');
                            }}
                        >ALL</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                                this.props.onChangeYear('2019');
                            }}
                        >19</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                                this.props.onChangeYear('2018');
                            }}
                        >18</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                                this.props.onChangeYear('2017');
                            }}
                        >17</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                                this.props.onChangeYear('2016');
                            }}
                        >16</a>
                    </li>
                    <li>
                        <a
                            href=""
                            onClick={(e) => {
                                e.preventDefault();
                                this.props.onChangeYear('2015');
                            }}
                        >15</a>
                    </li>
                </ul>
            </div>
        );
    }
}

export default Header;
